webpackJsonp([0xa2e55feb3493],{611:function(e,a){e.exports={pathContext:{docHtml:'<h1>NATS Gateway &#x26; Sensor</h1>\n<p>NATS subjects act as event sources for gateway</p>\n<ol>\n<li><a href="#example-event-sources-definition">Example event sources definition</a></li>\n<li><a href="#install-gateway">Install gateway</a></li>\n<li><a href="#install-sensor">Install sensor</a></li>\n<li><a href="#trigger-workflow">Trigger Workflow</a></li>\n</ol>\n<h2>Example event sources definition</h2>\n<pre><code class="language-yaml">apiVersion: v1\nkind: ConfigMap\nmetadata:\n name: nats-gateway-configmap\ndata:\n foo: |-\n   url: nats://nats.argo-events:4222 # nats service\n   subject: foo # subject to listen to\n</code></pre>\n<p>Create gateway event sources</p>\n<pre><code class="language-yaml">kubectl -n argo-events create -f  https://github.com/argoproj/argo-events/blob/master/examples/gateways/nats-gateway-configmap.yaml\n</code></pre>\n<h2>Install gateway</h2>\n<ol>\n<li>\n<p><strong>Create gateway</strong></p>\n<pre><code class="language-yaml">kubectl -n argo-events create -f https://github.com/argoproj/argo-events/blob/master/examples/gateways/nats.yaml\n</code></pre>\n</li>\n<li>\n<p><strong>Check the status of the gateway</strong></p>\n<pre><code class="language-yaml">kubectl -n argo-events describe gateway nats-gateway\n</code></pre>\n<p>Make sure the gateway is in active state and all the event sources are in running state.</p>\n</li>\n</ol>\n<h2>Install Sensor</h2>\n<pre><code class="language-yaml">kubectl -n argo-events create -f https://github.com/argoproj/argo-events/blob/master/examples/sensors/nats.yaml\n</code></pre>\n<h2>Trigger Workflow</h2>\n<p>Publish message to subject <code>foo</code>. You might find this useful <a href="https://github.com/nats-io/go-nats/tree/master/examples/nats-pub">https://github.com/nats-io/go-nats/tree/master/examples/nats-pub</a></p>',docPath:"argo-events/gateways/core/stream/nats/install",proj:"argo-events"}}}});
